member.example:
The following code hides the Sheet Tabs and Tab Scrolling Buttons for the spreadsheet.
[C#] // Hide the spreadsheet tabs. workbook.ShowTabs = false;
[Visual Basic] ' Hide the spreadsheet tabs. workbook.ShowTabs = False

The following code makes the horizontal scroll bar invisible for the spreadsheet.
[C#] // Hide the horizontal scroll bar of the Excel file. workbook.IsHScrollBarVisible = false;
[Visual Basic] ' Hide the horizontal scroll bar of the Excel file. workbook.IsHScrollBarVisible = False

The following code makes the vertical scroll bar invisible for the spreadsheet.
[C#] // Hide the vertical scroll bar of the Excel file. workbook.IsVScrollBarVisible = false;
[Visual Basic] ' Hide the vertical scroll bar of the Excel file. workbook.IsVScrollBarVisible = False

